import { useDispatch, useSelector } from "react-redux";
import { showUser } from "../features/userDetailSlice";

const Read=()=>{

    const dispatch=useDispatch();
    const {users,loading}=useSelector((state)=>state.app)

    useEffect(()=>{
        console.log('users from show=',users);
        dispatch(showUser());
    },[])

    return (
        <div>
          {users.map((ele) => (
            <div key={ele.id}>
                <h2>{ele.name}</h2>
              <p>{ele.e}</p>
            </div>
          ))}
        </div>
      );


}
export default Read;


